def is_valid_nqueens(queens):
    n = len(queens)
    for i in range(n):
        for j in range(i + 1, n):
            # Check if queens are in the same column
            # Subtract 1 from each queen's position since the list starts at index 1
            if queens[i] - 1 == queens[j] - 1:
                return False
            # Check if queens are on the same diagonal
            if abs((queens[i] - 1) - (queens[j] - 1)) == j - i:
                return False
    return True


